INSERT INTO CAT_TEMPLATES VALUES(12,'DV2_STAGE_LOAD','JRuby','This script takes a SOURCE TO STAGE mapping and generates the appropriate staging table load code.  The source and the staging table must be in SQLServer, and must be in the same instance of SQLServer.  The generated code executes hash key and hash difference computations, adds load dates, and record sources before loading the staging data.',NULL,'rapidgends/RapidGenDS.png','1',6,'1',NULL,'NULL','RapidGenDS','2015-07-08 11:54:00.547000','RapidGenDS','2015-07-08 11:54:00.547000',1,'SQL','.sql','0','1','0','0','0','0','0',NULL)
INSERT INTO CAT_TEMPLATES VALUES(13,'DV2_HUB_LINK_LOAD','JRuby','This script takes a STAGING table input (source in the MAPPING design), and generates a HUB or a LINK target view, so that the view can be used /called in conjunction with inserts to the target directly.    The source and target are required to be in the same instance of SQLServer.',NULL,'rapidgends/RapidGenDS.png','1',6,'1',NULL,'NULL','RapidGenDS','2015-07-08 11:54:00.547000','RapidGenDS','2015-07-08 11:54:00.547000',2,'SQL','.sql','0','1','0','0','0','0','0',NULL)
INSERT INTO CAT_TEMPLATES VALUES(14,'DV2_SATELLITE_LOAD','JRuby','This script takes a STAGING table input (source in the mapping design), and generates a SATELLITE load target view, so that the view can be used/called in conjunction with inserts to the target Satellite table directly.  The source and target are required to be in the same instance of SQLServer.',NULL,'rapidgends/RapidGenDS.png','1',6,'1',NULL,'NULL','RapidGenDS','2015-07-08 11:54:00.547000','RapidGenDS','2015-07-08 11:54:00.547000',3,'SQL','.sql','0','1','0','0','0','0','0',NULL)
INSERT INTO CAT_TEMPLATES VALUES(15,'DV2_SATELLITE_END_DATE','JRuby','This script takes a single target Satellite (the Satellite is both the source and the target at the same time), and generates 1) a select statement for a view, to pull the keys that need end-dating, and 2) also generates an UPDATE stored procedure, to execute the end-dating process.',NULL,'rapidgends/RapidGenDS.png','1',6,'1',NULL,'NULL','RapidGenDS','2015-07-08 11:54:00.547000','RapidGenDS','2015-07-08 11:54:00.547000',4,'SQL','.sql','0','1','0','0','0','0','0',NULL)
