INSERT INTO LANGUAGE_PREFERENCES VALUES(797,'com.ads.mm.stb.prdteffictprocess','The product causes efficiencies in process people policy/rights management not only in the spec development part of integration but also in downstream work flows in coding ETL testing and implementation by speeding tightening and improving those deliverables.','The product causes efficiencies in process people policy/rights management not only in the spec development part of integration but also in downstream work flows in coding ETL testing and implementation by speeding tightening and improving those deliverables.','','','','','','','',224)
