INSERT INTO LANGUAGE_PREFERENCES VALUES(800,'com.ads.mm.stb.prdtenhanceaccnt','The product enhances accountability among project resources\u0009 and enhances performance management and project delivery for supervisors and creates visibility for upper management','The product enhances accountability among project resources\u0009 and enhances performance management and project delivery for supervisors and creates visibility for upper management','','','','','','','',224)
