INSERT INTO LANGUAGE_PREFERENCES VALUES(802,'com.ads.mm.stb.anamapmgr','Analytix: Mapping Manager','Analytix: Mapping Manager','','','','','','','',224)
INSERT INTO LANGUAGE_PREFERENCES VALUES(803,'com.ads.mm.stb.firstenterprisesoftware','is the first enterprise software in the integration industry which brings standards\u0009 management and collaboration to one of the remaining areas in the industry which is untouched by product: pre-ETL Data Mapping Specifications. ETL\u0009 QA\u0009 profiling and requirements phases all have their tools\u0009 but there are none of any consequence in the mission-critical\u0009 error-prone pre-ETL data spec/mapping phase of large implementations. MS Excel currently occupies the space\u0009 but does it very poorly and the Mapping Specs cannot be managed or versioned appropriately for system integration projects. With the onslaught of products servicing integration\u0009 it''s hard to understand why this gap persists\u0009 but it does. We see it as the Achilles Heel of integration and the last area of the ETL Suite of tools that is yet integrated with the ETL tool vendors','is the first enterprise software in the integration industry which brings standards, management and collaboration to one of the remaining areas in the industry which is untouched by product: pre-ETL Data Mapping Specifications. ETL, QA, profiling and requirements phases all have their tools, but there are none of any consequence in the mission-critical, error-prone pre-ETL data spec/mapping phase of large implementations. MS Excel currently occupies the space, but does it very poorly and the Mapping Specs cannot be managed or versioned appropriately for system integration projects. With the onslaught of products servicing integration, it''s hard to understand why this gap persists, but it does. We see it as the Achilles Heel of integration and the last area of the ETL Suite of tools that is yet integrated with the ETL tool vendors','','','','','','','',224)
INSERT INTO LANGUAGE_PREFERENCES VALUES(804,'com.ads.mm.stb.analytixmapmgrbrings','Analytix: Mapping Manager brings standards control Audit ability traceability and versioning across all integration projects at the enterprise level. Analytix Mapping Manager takes an ETL agnostic approach to integrating it''s mapping specifications with ETL tool providers (like Informatica IBM Information Server - formerly known as Essential DataStage Abinitio etc to auto - generate the first level of ETL Jobs).','Analytix: Mapping Manager brings standards control Audit ability traceability and versioning across all integration projects at the enterprise level. Analytix Mapping Manager takes an ETL agnostic approach to integrating it''s mapping specifications with ETL tool providers (like Informatica IBM Information Server - formerly known as Essential DataStage Abinitio etc to auto - generate the first level of ETL Jobs).','','','','','','','',224)
INSERT INTO LANGUAGE_PREFERENCES VALUES(805,'com.ads.mm.stb.prdtdesc','Product Description','Product Description','','','','','','','',224)
INSERT INTO LANGUAGE_PREFERENCES VALUES(806,'com.ads.mm.stb.mapmgrmetadata','Analytix: Mapping Manager is 100% metadata driven and is used to define and drive standards across integration projects within an enterprise, enable data & process audits, improve data quality, streamline downstream workflows, increase productivity (especially over geographically dispersed teams and give project teams, IT leadership and management visibility into the ''real'' status of integration projects across the enterprise. Mapping Manager is a complement to existing products and allows the business analyst to dynamically build mapping specifications (via drag and dropping of metadata from the metadata browser which become clean, approved requirements/ inputs to ETL developers. These specifications are then versionable, tractable, auditable, and repeatable throughout the lifecycle of integration projects','Analytix: Mapping Manager is 100% metadata driven and is used to define and drive standards across integration projects within an enterprise, enable data & process audits, improve data quality, streamline downstream workflows, increase productivity (especially over geographically dispersed teams and give project teams, IT leadership and management visibility into the ''real'' status of integration projects across the enterprise. Mapping Manager is a complement to existing products and allows the business analyst to dynamically build mapping specifications (via drag and dropping of metadata from the metadata browser which become clean, approved requirements/ inputs to ETL developers. These specifications are then versionable, tractable, auditable, and repeatable throughout the lifecycle of integration projects','','','','','','','',224)
INSERT INTO LANGUAGE_PREFERENCES VALUES(807,'com.ads.mm.stb.amongtheprdtfunc','Among the products functions, it has built in Impact Analysis and data lineage views across the enterprise, uploads client SDM and other documentation at the project, system and individual mapping specification levels for compliance and tracking, defines mapping rules & standards, analyzes upstream and downstream system impacts and features a metadata browser which enables uploading of source system data tables from all DB platforms at the catalog and metadata level and specifications and drill downs to mapping targets as well as many more. In addition, the tool carries special handling instructions for sensitive data requiring encryption such as SOX, HIPPA, goV etc','Among the products functions, it has built in Impact Analysis and data lineage views across the enterprise, uploads client SDM and other documentation at the project, system and individual mapping specification levels for compliance and tracking, defines mapping rules & standards, analyzes upstream and downstream system impacts and features a metadata browser which enables uploading of source system data tables from all DB platforms at the catalog and metadata level and specifications and drill downs to mapping targets as well as many more. In addition, the tool carries special handling instructions for sensitive data requiring encryption such as SOX, HIPPA, goV etc','','','','','','','',224)
INSERT INTO LANGUAGE_PREFERENCES VALUES(808,'com.ads.mm.stb.devplatform','The development platform is 100% web enabled (no fat client Java Eclipse based and the GUI features a full range of excel like features and drag and drop functionality. The product is a culmination of 24 months development work\u0009 is a complement to existing integration products and vendors\u0009 and is non disruptive to existing team structures\u0009 role or responsibilities. Analytix Mapping Manager was born out of systems integration specialist''s direct experience of more than 15 years of working with ETL Tools and the gaps and weaknesses in the data mapping specification area and seeing many full lifecycle integrations projects through to completion. The product was designed and developed to not only fill the GAP of having the ability to manage and version mapping specifications\u0009 but to also streamline and improve current process and drive standards around the entire mapping specification analysis process and across the enterprise for all integration projects.','The development platform is 100% web enabled (no fat client Java Eclipse based and the GUI features a full range of excel like features and drag and drop functionality. The product is a culmination of 24 months development work\u0009 is a complement to existing integration products and vendors\u0009 and is non disruptive to existing team structures\u0009 role or responsibilities. Analytix Mapping Manager was born out of systems integration specialist''s direct experience of more than 15 years of working with ETL Tools and the gaps and weaknesses in the data mapping specification area and seeing many full lifecycle integrations projects through to completion. The product was designed and developed to not only fill the GAP of having the ability to manage and version mapping specifications\u0009 but to also streamline and improve current process and drive standards around the entire mapping specification analysis process and across the enterprise for all integration projects.','','','','','','','',224)
