CREATE VIEW ALLMAPPINGSTESTSTATUS (TESTSTATUS,MAPPINGSCOUNT,PROJECT_ID,PROJECTNAME,MAPPINGSTATUS) AS SELECT ISNULL(TEST_DISPOSITION,'U')TESTSTATUS,COUNT(MAP_ID)MAPPINGSCOUNT,PROJECT_ID,PROJECT.PROJ_NAME AS PROJECTNAME,STATUS AS MAPPINGSTATUS FROM MAPPING_DETAILS LEFT JOIN PROJECT ON PROJECT.PROJ_ID=MAPPING_DETAILS.PROJECT_ID GROUP BY TEST_DISPOSITION,PROJECT_ID,PROJECT.PROJ_NAME,STATUS;
CREATE VIEW MAP_SPEC_SUMMARY_V (PROJ_ID,MAP_ID,MAP_SEQ_ID,EXTENDED_BUS_RULE,SRC_SYSTEM_ID,SRC_SYSTEM_NAME,SRC_SYSTEM_ENVIRONMENT_NAME,SRC_TABLE_NAME,SRC_COLUMN_NAME,SRC_COL_DATATYPE,SRC_COL_LENGTH,SRC_COL_PRECISION,SRC_COL_SCALE,SRC_COL_DB_DEFAULT_VALUE,SRC_COL_DEF,SRC_COL_IDENTITY_FLAG,SRC_COL_NULLABLE_FLAG,SRC_PERCENT_NULL_VALUE,SRC_NATURAL_KEY_FLAG,SRC_MIN_VALUE,SRC_MAX_VALUE,TGT_SYSTEM_ID,TGT_SYSTEM_NAME,TGT_SYSTEM_ENVIRONMENT_NAME,TGT_TABLE_NAME,TGT_COLUMN_NAME,TGT_COL_DATATYPE,TGT_COL_LENGTH,TGT_COL_PRECISION,TGT_COL_SCALE,TGT_COL_ETL_DEFAULT_VALUE,TGT_COL_DEF,TGT_NATURAL_KEY_FLAG,TGT_PRIMARY_KEY_FLAG,LOOKUP_COLUMN,TRNSF_LOOKUP_CONDITION,LOOKUP_ON,BUSINESS_RULE,COL_MAP_COMPLETE_FLAG,LAST_MODIFIED_BY,LAST_MODIFIED_DATE_TIME,CREATED_BY,CREATED_DATETIME,USER_DEFINATION1,USER_DEFINATION2,USER_DEFINATION3,USER_DEFINATION4,MAP_SPECROWCOMMENTS,TGT_COL_NULLABLE_FLAG,SRC_SDI_FLAG,SRC_SDI_DESCRIPTION,TGT_SDI_FLAG,TGT_SDI_DESCRIPTION,PSUEDO_CODE) AS SELECT PROJ_ID,MAP_ID,MAP_SEQ_ID,EXTENDED_BUS_RULE,SRC_SYSTEM_ID,SRC_SYSTEM_NAME,SRC_SYSTEM_ENVIRONMENT_NAME,SRC_TABLE_NAME,SRC_COLUMN_NAME,SRC_COL_DATATYPE,SRC_COL_LENGTH,SRC_COL_PRECISION,SRC_COL_SCALE,SRC_COL_DB_DEFAULT_VALUE,SRC_COL_DEF,SRC_COL_IDENTITY_FLAG,SRC_COL_NULLABLE_FLAG,SRC_PERCENT_NULL_VALUE,SRC_NATURAL_KEY_FLAG,SRC_MIN_VALUE,SRC_MAX_VALUE,TGT_SYSTEM_ID,TGT_SYSTEM_NAME,TGT_SYSTEM_ENVIRONMENT_NAME,TGT_TABLE_NAME,TGT_COLUMN_NAME,TGT_COL_DATATYPE,TGT_COL_LENGTH,TGT_COL_PRECISION,TGT_COL_SCALE,TGT_COL_ETL_DEFAULT_VALUE,TGT_COL_DEF,TGT_NATURAL_KEY_FLAG,TGT_PRIMARY_KEY_FLAG,LOOKUP_COLUMN,TRNSF_LOOKUP_CONDITION,LOOKUP_ON,BUSINESS_RULE,COL_MAP_COMPLETE_FLAG,MS.LAST_MODIFIED_BY,MS.LAST_MODIFIED_DATE_TIME,MS.CREATED_BY,MS.CREATED_DATETIME,USER_DEFINATION1,USER_DEFINATION2,USER_DEFINATION3,USER_DEFINATION4,MAP_SPECROWCOMMENTS,TGT_COL_NULLABLE_FLAG,SRC_SDI_FLAG,SRC_SDI_DESCRIPTION,TGT_SDI_FLAG,TGT_SDI_DESCRIPTION,ISNULL(T.PSUEDO_CODE,MS.BUSINESS_RULE)PSUEDO_CODE FROM MAPPING_SPECIFICATION MS LEFT OUTER JOIN TRANSFORMATIONS T ON MS.BUSINESS_RULE=T.TRANSF_NAME;
CREATE VIEW MAPPINGASSIGNEDBYUSER (MAPPINGSASSIGNED,USER_ID,MAPPINGSTATUS) AS SELECT COUNT(MAPPING_STATUS.MAP_ID)AS MAPPINGSASSIGNED,USER_ID,MAPPING_DETAILS.STATUS AS MAPPINGSTATUS FROM MAPPING_STATUS LEFT JOIN MAPPING_DETAILS ON MAPPING_DETAILS.MAP_ID=MAPPING_STATUS.MAP_ID GROUP BY USER_ID,MAPPING_DETAILS.STATUS;
CREATE VIEW MAPPINGSASSIGNEDBYPROJECT (MAPPINGSASSIGNED,PROJECT_ID,USER_ID,MAPPINGSTATUS) AS SELECT COUNT(MAPPING_DETAILS.MAP_ID)AS MAPPINGSASSIGNED,MAPPING_DETAILS.PROJECT_ID,PROJECT_RESOURCES.USER_ID,MAPPING_DETAILS.STATUS AS MAPPINGSTATUS FROM MAPPING_DETAILS LEFT OUTER JOIN PROJECT_RESOURCES ON PROJECT_RESOURCES.PROJ_ID=MAPPING_DETAILS.PROJECT_ID GROUP BY MAPPING_DETAILS.PROJECT_ID,PROJECT_RESOURCES.USER_ID,MAPPING_DETAILS.STATUS;
CREATE VIEW MAPPINGSASSIGNEDBYUSER (MAPPINGSASSIGNED,USER_ID,MAPPINGSTATUS) AS SELECT COUNT(MAPPING_STATUS.MAP_ID)AS MAPPINGSASSIGNED,USER_ID,MAPPING_DETAILS.STATUS AS MAPPINGSTATUS FROM MAPPING_STATUS LEFT JOIN MAPPING_DETAILS ON MAPPING_DETAILS.MAP_ID=MAPPING_STATUS.MAP_ID GROUP BY USER_ID,MAPPING_DETAILS.STATUS;
CREATE VIEW MAPPINGTESTSTATUS (TESTSTATUS,MAP_ID,MAP_NAME,MAP_SPEC_VERSION,VERSIONLABEL,TESTING_NOTES,PROJECT_ID,PROJECTNAME,PROJECTDESCRIPTION,MAPPINGSTATUS) AS SELECT CASE WHEN TEST_DISPOSITION='U'THEN'UNASSIGNED'ELSE CASE WHEN TEST_DISPOSITION='P'THEN'PASSED'ELSE CASE WHEN TEST_DISPOSITION='F'THEN'FAILED'ELSE CASE WHEN TEST_DISPOSITION='A'THEN'NEEDS ANALYSIS'ELSE''END END END END AS TESTSTATUS,MAP_ID,MAP_NAME,MAP_SPEC_VERSION,VERSIONLABEL,TESTING_NOTES,PROJECT_ID,PROJECT.PROJ_NAME AS PROJECTNAME,PROJECT.PROJ_DESCR AS PROJECTDESCRIPTION,STATUS AS MAPPINGSTATUS FROM MAPPING_DETAILS LEFT JOIN PROJECT ON PROJECT.PROJ_ID=MAPPING_DETAILS.PROJECT_ID;
CREATE VIEW TOTALMAPPINGSBYPROJECT (PROJECTID,TOTALMAPPINGS,PROJECTNAME,MAPPINGSTATUS) AS SELECT PROJECT.PROJ_ID PROJECTID,COUNT(MAP_ID)TOTALMAPPINGS,PROJ_NAME PROJECTNAME,STATUS AS MAPPINGSTATUS FROM MAPPING_DETAILS LEFT JOIN PROJECT ON PROJECT.PROJ_ID=MAPPING_DETAILS.PROJECT_ID GROUP BY PROJECT.PROJ_ID,PROJ_NAME,STATUS;
CREATE VIEW PROJ_MAP_INTG_STATUS_SUMMARY_V (PROJECTID,PROJECTNAME,TOTALMAPPINGS,MAPPCOMPLETECOUNT,MAPPINPROGRESSCOUNT,MAPPNOTSTARTEDCOUNT,MAPPONHOLDCOUNT,MDSGCOMPLETECOUNT,MDSGINPROGRESSCOUNT,MDSGNOTSTARTEDCOUNT,MDSGONHOLDCOUNT,METLDEVCOMPLETECOUNT,METLDEVINPROGRESSCOUNT,METLDEVNOTSTARTEDCOUNT,METLDEVONHOLDCOUNT,MTSTRCOMPLETECOUNT,MTSTRINPROGRESSCOUNT,MTSTRNOTSTARTEDCOUNT,MTSTRONHOLDCOUNT) AS SELECT PROJECT.PROJ_ID AS PROJECTID,PROJ_NAME AS PROJECTNAME,TOTALMAPPINGS,SUM(CASE WHEN(RESPONSIABLES='Mapping Approver'AND MAPPING_STATUS.STATUS='Complete')THEN 1 ELSE 0 END)AS MAPPCOMPLETECOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Approver'AND MAPPING_STATUS.STATUS='In Progress')THEN 1 ELSE 0 END)AS MAPPINPROGRESSCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Approver'AND MAPPING_STATUS.STATUS='Not Started')THEN 1 ELSE 0 END)AS MAPPNOTSTARTEDCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Approver'AND MAPPING_STATUS.STATUS='On Hold')THEN 1 ELSE 0 END)AS MAPPONHOLDCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Designer'AND MAPPING_STATUS.STATUS='Complete')THEN 1 ELSE 0 END)AS MDSGCOMPLETECOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Designer'AND MAPPING_STATUS.STATUS='In Progress')THEN 1 ELSE 0 END)AS MDSGINPROGRESSCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Designer'AND MAPPING_STATUS.STATUS='Not Started')THEN 1 ELSE 0 END)AS MDSGNOTSTARTEDCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Designer'AND MAPPING_STATUS.STATUS='On Hold')THEN 1 ELSE 0 END)AS MDSGONHOLDCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping ETL Developer'AND MAPPING_STATUS.STATUS='Complete')THEN 1 ELSE 0 END)AS METLDEVCOMPLETECOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping ETL Developer'AND MAPPING_STATUS.STATUS='In Progress')THEN 1 ELSE 0 END)AS METLDEVINPROGRESSCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping ETL Developer'AND MAPPING_STATUS.STATUS='Not Started')THEN 1 ELSE 0 END)AS METLDEVNOTSTARTEDCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping ETL Developer'AND MAPPING_STATUS.STATUS='On Hold')THEN 1 ELSE 0 END)AS METLDEVONHOLDCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Tester'AND MAPPING_STATUS.STATUS='Complete')THEN 1 ELSE 0 END)AS MTSTRCOMPLETECOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Tester'AND MAPPING_STATUS.STATUS='In Progress')THEN 1 ELSE 0 END)AS MTSTRINPROGRESSCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Tester'AND MAPPING_STATUS.STATUS='Not Started')THEN 1 ELSE 0 END)AS MTSTRNOTSTARTEDCOUNT,SUM(CASE WHEN(RESPONSIABLES='Mapping Tester'AND MAPPING_STATUS.STATUS='On Hold')THEN 1 ELSE 0 END)AS MTSTRONHOLDCOUNT FROM MAPPING_STATUS LEFT JOIN PROJECT ON PROJECT.PROJ_ID=MAPPING_STATUS.PROJ_ID LEFT JOIN MAPPING_DETAILS ON MAPPING_DETAILS.MAP_ID=MAPPING_STATUS.MAP_ID LEFT JOIN TOTALMAPPINGSBYPROJECT ON TOTALMAPPINGSBYPROJECT.PROJECTID=PROJECT.PROJ_ID WHERE MAPPING_DETAILS.STATUS='Active'AND MAPPING_STATUS.STATUS<>''AND MAPPING_STATUS.STATUS<>'unassigned'AND TOTALMAPPINGSBYPROJECT.MAPPINGSTATUS='Active'GROUP BY PROJECT.PROJ_ID,PROJ_NAME,TOTALMAPPINGS;
CREATE VIEW SYSTEMDATADICTIONARYSUMMARY (SYSTEM_ID,SYSTEM_ENV_NAME,TABLECOUNT,COLUMNCOUNT) AS SELECT SYSTEM_TABLE_COLUMNS_METADATA.SYSTEM_ID,SYSTEM_TABLE_METADATA.SYSTEM_ENV_NAME,COUNT(DISTINCT SYSTEM_TABLE_COLUMNS_METADATA.TABLE_NAME)TABLECOUNT,COUNT(SYSTEM_TABLE_COLUMNS_METADATA.COLUMN_NAME)COLUMNCOUNT FROM SYSTEM_TABLE_COLUMNS_METADATA LEFT JOIN SYSTEM_TABLE_METADATA ON SYSTEM_TABLE_COLUMNS_METADATA.SYSTEM_ID=SYSTEM_TABLE_METADATA.SYSTEM_ID AND SYSTEM_TABLE_COLUMNS_METADATA.TABLE_NAME=SYSTEM_TABLE_METADATA.TABLE_NAME AND SYSTEM_TABLE_COLUMNS_METADATA.SYSTEM_ENV_NAME=SYSTEM_TABLE_METADATA.SYSTEM_ENV_NAME GROUP BY SYSTEM_TABLE_COLUMNS_METADATA.SYSTEM_ID,SYSTEM_TABLE_METADATA.SYSTEM_ENV_NAME;
CREATE VIEW TESTERMAPPINGS (MAP_ID,PROJ_ID,USER_ID,RESPONSIABLES,STATUS,LOGIN_USER,ASSIGNMENT_CHANGES,EMAIL_CCLIST,EMAIL_EXTRA_CONTENT) AS SELECT MAPPING_STATUS.MAP_ID,MAPPING_STATUS.PROJ_ID,MAPPING_STATUS.USER_ID,MAPPING_STATUS.RESPONSIABLES,MAPPING_STATUS.STATUS,MAPPING_STATUS.LOGIN_USER,MAPPING_STATUS.ASSIGNMENT_CHANGES,MAPPING_STATUS.EMAIL_CCLIST,MAPPING_STATUS.EMAIL_EXTRA_CONTENT FROM MAPPING_STATUS WHERE RESPONSIABLES='MAPPING TESTER';
CREATE VIEW TESTING_STATUS_DETAILS_V (TESTSTATUS,MAP_ID,MAP_NAME,MAP_SPEC_VERSION,VERSIONLABEL,TESTING_NOTES,PROJECT_ID,PROJECTNAME,PROJECTDESCRIPTION,MAPPINGSTATUS,TESTERSTATUS,ASSIGNEDTOUSERID,ASSGINEDTOUSERNAME) AS SELECT MAPPINGTESTSTATUS.TESTSTATUS,MAPPINGTESTSTATUS.MAP_ID,MAPPINGTESTSTATUS.MAP_NAME,MAPPINGTESTSTATUS.MAP_SPEC_VERSION,MAPPINGTESTSTATUS.VERSIONLABEL,MAPPINGTESTSTATUS.TESTING_NOTES,MAPPINGTESTSTATUS.PROJECT_ID,MAPPINGTESTSTATUS.PROJECTNAME,MAPPINGTESTSTATUS.PROJECTDESCRIPTION,MAPPINGTESTSTATUS.MAPPINGSTATUS,ISNULL(TESTERMAPPINGS.STATUS,'')AS TESTERSTATUS,ISNULL(TESTERMAPPINGS.USER_ID,'')ASSIGNEDTOUSERID,ISNULL(USERS.USER_FULL_NAME,'')AS ASSGINEDTOUSERNAME FROM MAPPINGTESTSTATUS LEFT JOIN TESTERMAPPINGS ON MAPPINGTESTSTATUS.MAP_ID=TESTERMAPPINGS.MAP_ID LEFT JOIN USERS ON TESTERMAPPINGS.USER_ID=USERS.USER_ID;
CREATE VIEW TOTALMAPPINGSASSIGNED (MAPPINGSASSIGNED,USER_ID,MAPPINGSTATUS) AS SELECT SUM(MAPPINGSASSIGNED)MAPPINGSASSIGNED,USER_ID,MAPPINGSTATUS FROM MAPPINGSASSIGNEDBYPROJECT GROUP BY USER_ID,MAPPINGSTATUS;
CREATE VIEW V_CODESET_DETAILS (CODESET_ID,CODESET_NAME,CODESET_VERSION,CODE_ID,CODE_VALUE,CODE_NAME,CODE_DESC,SYSTEM_NAME) AS SELECT B.CODESET_ID,B.CODESET_NAME,B.CODESET_VERSION,C.CODE_ID,C.CODE_STND_VALUE AS CODE_VALUE,C.CODE_NAME,C.CODE_DESC,CASE WHEN(C.SYSTEM_ENV_NAME IS NULL OR LTRIM(RTRIM(C.SYSTEM_ENV_NAME))='')THEN C.SYSTEM_NAME ELSE C.SYSTEM_ENV_NAME END AS SYSTEM_NAME FROM CSM_CODESET B,CSM_CODE_VALUE C WHERE B.CODESET_ID=C.CODESET_ID AND C.DELETE_FLAG='N';
CREATE VIEW V_CSM_CODE_DETAILS (CODE_ID,CODE_STND_VALUE,CODE_NAME,SYSTEM_NAME,CODESET_NAME,CATEGORY_NAME) AS SELECT C.CODE_ID,C.CODE_STND_VALUE,C.CODE_NAME,ISNULL(C.SYSTEM_NAME,SYSTEM_ENV_NAME)AS SYSTEM_NAME,B.CODESET_NAME,A.CATEGORY_NAME FROM CSM_CATEGORY A,CSM_CODESET B,CSM_CODE_VALUE C WHERE A.CATEGORY_ID=B.CATEGORY_ID AND B.CODESET_ID=C.CODESET_ID;
