-------------------FN_SPLITTREENODEIDS-------------------
CREATE FUNCTION FN_SPLITTREENODEIDS(TREENODEIDARRAY VARCHAR (4000),DELIMITER VARCHAR (10)) RETURNS TABLE (TREENODEID INTEGER) SPECIFIC SPLITTREENODEIDS_SPEC READS SQL DATA SIGNAL SQLSTATE '45000';

ALTER SPECIFIC ROUTINE SPLITTREENODEIDS_SPEC
BEGIN ATOMIC
DECLARE TABLE VALUETABLE(TREENODEID INTEGER);
DECLARE NEXTSTRING VARCHAR(4000);
DECLARE POS INT;
DECLARE NEXTPOS INT;
DECLARE COMMACHECK VARCHAR(1);
DECLARE TREENODEIDARRAYHELPER VARCHAR (4000);
SET TREENODEIDARRAYHELPER = TREENODEIDARRAY;
SET NEXTSTRING = '';
SET COMMACHECK = RIGHT(TREENODEIDARRAY,1);
SET TREENODEIDARRAYHELPER = TREENODEIDARRAYHELPER + DELIMITER;
SET POS = LOCATE(DELIMITER,TREENODEIDARRAYHELPER);
SET NEXTPOS = 1;
SPLITNODESWHILE:  WHILE POS <>  0 
DO
  SET NEXTSTRING = SUBSTRING(TREENODEIDARRAYHELPER, 1, POS - 1);
   SET TREENODEIDARRAYHELPER = SUBSTRING(TREENODEIDARRAYHELPER,POS +1,LENGTH(TREENODEIDARRAYHELPER));
   SET NEXTPOS = POS;
  SET POS  = LOCATE(DELIMITER,TREENODEIDARRAYHELPER);
 END WHILE SPLITNODESWHILE;
 RETURN TABLE(SELECT * FROM VALUETABLE);
END


-------------------FN_SPLITAPENDSPEC-------------------
CREATE FUNCTION FN_SPLITAPENDSPEC(SPECIFICATIONVALUE VARCHAR (4000)) 
RETURNS VARCHAR(4000)
SPECIFIC FN_SPLITAPENDSPEC_HELPER
READS SQL DATA
SIGNAL SQLSTATE '45000'

ALTER SPECIFIC ROUTINE FN_SPLITAPENDSPEC_HELPER
BEGIN ATOMIC
IF SPECIFICATIONVALUE <> '' THEN
	IF LOCATE(CHAR(10), SPECIFICATIONVALUE) <> 0 THEN
		RETURN INSERT(SPECIFICATIONVALUE, 1, LOCATE(CHAR(10), SPECIFICATIONVALUE || CHAR(10)), '');
	ELSE 
		RETURN INSERT(SPECIFICATIONVALUE, 1, LOCATE(CHAR(10), SPECIFICATIONVALUE || CHAR(10)) - 1, '');
	END IF;
END IF;
RETURN '';
END

-------------------FN_MAPSPEC_SRC-------------------
CREATE FUNCTION FN_MAPSPEC_SRC() 
RETURNS TABLE(SRC_SYSTEM_NAME VARCHAR(4000), SRC_SYSTEM_ENVIRONMENT_NAME VARCHAR(4000), SRC_TABLE_NAME VARCHAR(4000), SRC_COLUMN_NAME VARCHAR(4000),
	SRC_COL_DATATYPE VARCHAR(4000), SRC_COL_LENGTH VARCHAR(50), SRC_COL_PRECISION VARCHAR(50), SRC_COL_SCALE VARCHAR(50), MAP_SEQ_ID INTEGER, MAP_ID BIGINT, PROJ_ID INTEGER)
SPECIFIC MAPSPEC_SRC_SPEC
READS SQL DATA
SIGNAL SQLSTATE '45000'

ALTER SPECIFIC ROUTINE MAPSPEC_SRC_SPEC
BEGIN ATOMIC
RETURN TABLE(WITH RECURSIVE SRC_MAPPING_SPEC_DATA(SRC_SYSTEM_NAME, SRC_SYSTEM_NAME1, SRC_SYSTEM_ENVIRONMENT_NAME, SRC_SYSTEM_ENVIRONMENT_NAME1, 
SRC_TABLE_NAME, SRC_TABLE_NAME1, SRC_COLUMN_NAME, SRC_COLUMN_NAME1, SRC_COL_DATATYPE, SRC_COL_DATATYPE1, SRC_COL_LENGTH, SRC_COL_LENGTH1,
 SRC_COL_PRECISION, SRC_COL_PRECISION1, SRC_COL_SCALE, SRC_COL_SCALE1, MAP_SEQ_ID, MAP_ID, PROJ_ID) AS
  (SELECT LEFT(MS.SRC_SYSTEM_NAME, LOCATE(CHAR(10), MS.SRC_SYSTEM_NAME || CHAR(10))-1) SRC_SYSTEM_NAME,
		  FN_SPLITAPENDSPEC(MS.SRC_SYSTEM_NAME) SRC_SYSTEM_NAME1,
          LEFT(MS.SRC_SYSTEM_ENVIRONMENT_NAME, LOCATE(CHAR(10), MS.SRC_SYSTEM_ENVIRONMENT_NAME || CHAR(10))-1) SRC_SYSTEM_ENVIRONMENT_NAME,
		  FN_SPLITAPENDSPEC(MS.SRC_SYSTEM_ENVIRONMENT_NAME) SRC_SYSTEM_ENVIRONMENT_NAME1,
          LEFT(MS.SRC_TABLE_NAME, LOCATE(CHAR(10), MS.SRC_TABLE_NAME || CHAR(10))-1) SRC_TABLE_NAME,
		  FN_SPLITAPENDSPEC(MS.SRC_TABLE_NAME) SRC_TABLE_NAME1,
          LEFT(MS.SRC_COLUMN_NAME, LOCATE(CHAR(10), MS.SRC_COLUMN_NAME || CHAR(10))-1) SRC_COLUMN_NAME,
		  FN_SPLITAPENDSPEC(MS.SRC_COLUMN_NAME) SRC_COLUMN_NAME1,
		  CAST(LEFT(MS.SRC_COL_DATATYPE, LOCATE(CHAR(10), MS.SRC_COL_DATATYPE || CHAR(10))-1) AS VARCHAR(4000)) SRC_COL_DATATYPE,
          CAST(FN_SPLITAPENDSPEC(MS.SRC_COL_DATATYPE) AS VARCHAR(4000)) SRC_COL_DATATYPE1,
          CAST(LEFT(MS.SRC_COL_LENGTH, LOCATE(CHAR(10), MS.SRC_COL_LENGTH || CHAR(10))-1) AS VARCHAR(50)) SRC_COL_LENGTH,
          CAST(FN_SPLITAPENDSPEC(MS.SRC_COL_LENGTH) AS VARCHAR(50)) SRC_COL_LENGTH1,
          CAST(LEFT(MS.SRC_COL_PRECISION, LOCATE(CHAR(10), MS.SRC_COL_PRECISION || CHAR(10))-1) AS VARCHAR(50)) SRC_COL_PRECISION,
          CAST(FN_SPLITAPENDSPEC(MS.SRC_COL_PRECISION) AS VARCHAR(50)) SRC_COL_PRECISION1,
          CAST(LEFT(MS.SRC_COL_SCALE, LOCATE(CHAR(10), MS.SRC_COL_SCALE || CHAR(10))-1) AS VARCHAR(50)) SRC_COL_SCALE,
          CAST(FN_SPLITAPENDSPEC(MS.SRC_COL_SCALE) AS VARCHAR(50)) SRC_COL_SCALE1,		  
		  MS.MAP_SEQ_ID,
          MS.MAP_ID,
          MS.PROJ_ID
   FROM MAPPING_SPECIFICATION MS
   WHERE MS.SRC_SYSTEM_NAME IS NOT NULL
     AND MS.SRC_SYSTEM_ENVIRONMENT_NAME IS NOT NULL
     AND MS.SRC_TABLE_NAME IS NOT NULL
     AND MS.SRC_COLUMN_NAME IS NOT NULL
   UNION SELECT LEFT(SRC_SYSTEM_NAME1, LOCATE(CHAR(10), SRC_SYSTEM_NAME1 || CHAR(10))-1),
			        FN_SPLITAPENDSPEC(SRC_SYSTEM_NAME1),   
                    LEFT(SRC_SYSTEM_ENVIRONMENT_NAME1, LOCATE(CHAR(10), SRC_SYSTEM_ENVIRONMENT_NAME1 || CHAR(10))-1),
					FN_SPLITAPENDSPEC(SRC_SYSTEM_ENVIRONMENT_NAME1) ,   
                    LEFT(SRC_TABLE_NAME1, LOCATE(CHAR(10), SRC_TABLE_NAME1 || CHAR(10))-1),
					FN_SPLITAPENDSPEC(SRC_TABLE_NAME1) ,                       
                    LEFT(SRC_COLUMN_NAME1, LOCATE(CHAR(10), SRC_COLUMN_NAME1 || CHAR(10))-1),
					FN_SPLITAPENDSPEC(SRC_COLUMN_NAME1) , 
                    CAST(LEFT(SRC_COL_DATATYPE1, LOCATE(CHAR(10), SRC_COL_DATATYPE1 || CHAR(10))-1) AS VARCHAR(4000)),
                    CAST(FN_SPLITAPENDSPEC(SRC_COL_DATATYPE1) AS VARCHAR(4000)),
                    CAST(LEFT(SRC_COL_LENGTH1, LOCATE(CHAR(10), SRC_COL_LENGTH1 || CHAR(10))-1) AS VARCHAR(50)),
                    CAST(FN_SPLITAPENDSPEC(SRC_COL_LENGTH1) AS VARCHAR(50)),
                    CAST(LEFT(SRC_COL_PRECISION1, LOCATE(CHAR(10), SRC_COL_PRECISION1 || CHAR(10))-1) AS VARCHAR(50)),
                    CAST(FN_SPLITAPENDSPEC(SRC_COL_PRECISION1) AS VARCHAR(50)),
                    CAST(LEFT(SRC_COL_SCALE1, LOCATE(CHAR(10), SRC_COL_SCALE1 || CHAR(10))-1) AS VARCHAR(50)),
                    CAST(FN_SPLITAPENDSPEC(SRC_COL_SCALE1) AS VARCHAR(50)),					
					MAP_SEQ_ID,					
                    MAP_ID,
                    PROJ_ID
   FROM SRC_MAPPING_SPEC_DATA
   WHERE SRC_COLUMN_NAME1 > ''
     OR SRC_TABLE_NAME1 > ''
     OR SRC_SYSTEM_ENVIRONMENT_NAME1 > ''
	 OR SRC_SYSTEM_NAME1 > '')
	 SELECT SRC_SYSTEM_NAME,SRC_SYSTEM_ENVIRONMENT_NAME, SRC_TABLE_NAME, SRC_COLUMN_NAME, SRC_COL_DATATYPE, SRC_COL_LENGTH,
	 SRC_COL_PRECISION, SRC_COL_SCALE, MAP_SEQ_ID, MAP_ID, PROJ_ID FROM SRC_MAPPING_SPEC_DATA
	 WHERE SRC_SYSTEM_NAME <> '' AND  SRC_SYSTEM_ENVIRONMENT_NAME <> '' AND SRC_TABLE_NAME <> '' AND SRC_COLUMN_NAME <> '');
END


-------------------FN_MAPSPEC_TGT-------------------
CREATE FUNCTION FN_MAPSPEC_TGT() 
RETURNS TABLE(TGT_SYSTEM_NAME VARCHAR(4000), TGT_SYSTEM_ENVIRONMENT_NAME VARCHAR(4000), TGT_TABLE_NAME VARCHAR(4000), TGT_COLUMN_NAME VARCHAR(4000),
	TGT_COL_DATATYPE VARCHAR(4000), TGT_COL_LENGTH VARCHAR(50), TGT_COL_PRECISION VARCHAR(50), TGT_COL_SCALE VARCHAR(50), MAP_SEQ_ID INTEGER, MAP_ID BIGINT, PROJ_ID INTEGER)
SPECIFIC MAPSPEC_TGT_SPEC
READS SQL DATA
SIGNAL SQLSTATE '45000'

ALTER SPECIFIC ROUTINE MAPSPEC_TGT_SPEC
BEGIN ATOMIC
RETURN TABLE(WITH RECURSIVE TGT_MAPPING_SPEC_DATA(TGT_SYSTEM_NAME, TGT_SYSTEM_NAME1, TGT_SYSTEM_ENVIRONMENT_NAME, TGT_SYSTEM_ENVIRONMENT_NAME1, 
TGT_TABLE_NAME, TGT_TABLE_NAME1, TGT_COLUMN_NAME, TGT_COLUMN_NAME1, TGT_COL_DATATYPE, TGT_COL_DATATYPE1, TGT_COL_LENGTH, TGT_COL_LENGTH1,
 TGT_COL_PRECISION, TGT_COL_PRECISION1, TGT_COL_SCALE, TGT_COL_SCALE1, MAP_SEQ_ID, MAP_ID, PROJ_ID) AS
  (SELECT LEFT(MS.TGT_SYSTEM_NAME, LOCATE(CHAR(10), MS.TGT_SYSTEM_NAME || CHAR(10))-1) TGT_SYSTEM_NAME,
		  FN_SPLITAPENDSPEC(MS.TGT_SYSTEM_NAME) TGT_SYSTEM_NAME1,
          LEFT(MS.TGT_SYSTEM_ENVIRONMENT_NAME, LOCATE(CHAR(10), MS.TGT_SYSTEM_ENVIRONMENT_NAME || CHAR(10))-1) TGT_SYSTEM_ENVIRONMENT_NAME,
		  FN_SPLITAPENDSPEC(MS.TGT_SYSTEM_ENVIRONMENT_NAME) TGT_SYSTEM_ENVIRONMENT_NAME1,
          LEFT(MS.TGT_TABLE_NAME, LOCATE(CHAR(10), MS.TGT_TABLE_NAME || CHAR(10))-1) TGT_TABLE_NAME,
		  FN_SPLITAPENDSPEC(MS.TGT_TABLE_NAME) TGT_TABLE_NAME1,
          LEFT(MS.TGT_COLUMN_NAME, LOCATE(CHAR(10), MS.TGT_COLUMN_NAME || CHAR(10))-1) TGT_COLUMN_NAME,
		  FN_SPLITAPENDSPEC(MS.TGT_COLUMN_NAME) TGT_COLUMN_NAME1,
		  CAST(LEFT(MS.TGT_COL_DATATYPE, LOCATE(CHAR(10), MS.TGT_COL_DATATYPE || CHAR(10))-1) AS VARCHAR(4000)) TGT_COL_DATATYPE,
          CAST(FN_SPLITAPENDSPEC(MS.TGT_COL_DATATYPE) AS VARCHAR(4000)) TGT_COL_DATATYPE1,
          CAST(LEFT(MS.TGT_COL_LENGTH, LOCATE(CHAR(10), MS.TGT_COL_LENGTH || CHAR(10))-1) AS VARCHAR(50)) TGT_COL_LENGTH,
          CAST(FN_SPLITAPENDSPEC(MS.TGT_COL_LENGTH) AS VARCHAR(50)) TGT_COL_LENGTH1,
          CAST(LEFT(MS.TGT_COL_PRECISION, LOCATE(CHAR(10), MS.TGT_COL_PRECISION || CHAR(10))-1) AS VARCHAR(50)) TGT_COL_PRECISION,
          CAST(FN_SPLITAPENDSPEC(MS.TGT_COL_PRECISION) AS VARCHAR(50)) TGT_COL_PRECISION1,
          CAST(LEFT(MS.TGT_COL_SCALE, LOCATE(CHAR(10), MS.TGT_COL_SCALE || CHAR(10))-1) AS VARCHAR(50)) TGT_COL_SCALE,
          CAST(FN_SPLITAPENDSPEC(MS.TGT_COL_SCALE) AS VARCHAR(50)) TGT_COL_SCALE1,		  
		  MS.MAP_SEQ_ID,
          MS.MAP_ID,
          MS.PROJ_ID
   FROM MAPPING_SPECIFICATION MS
   WHERE MS.TGT_SYSTEM_NAME IS NOT NULL
     AND MS.TGT_SYSTEM_ENVIRONMENT_NAME IS NOT NULL
     AND MS.TGT_TABLE_NAME IS NOT NULL
     AND MS.TGT_COLUMN_NAME IS NOT NULL
   UNION SELECT LEFT(TGT_SYSTEM_NAME1, LOCATE(CHAR(10), TGT_SYSTEM_NAME1 || CHAR(10))-1),
			        FN_SPLITAPENDSPEC(TGT_SYSTEM_NAME1),   
                    LEFT(TGT_SYSTEM_ENVIRONMENT_NAME1, LOCATE(CHAR(10), TGT_SYSTEM_ENVIRONMENT_NAME1 || CHAR(10))-1),
					FN_SPLITAPENDSPEC(TGT_SYSTEM_ENVIRONMENT_NAME1) ,   
                    LEFT(TGT_TABLE_NAME1, LOCATE(CHAR(10), TGT_TABLE_NAME1 || CHAR(10))-1),
					FN_SPLITAPENDSPEC(TGT_TABLE_NAME1) ,                       
                    LEFT(TGT_COLUMN_NAME1, LOCATE(CHAR(10), TGT_COLUMN_NAME1 || CHAR(10))-1),
					FN_SPLITAPENDSPEC(TGT_COLUMN_NAME1) , 
                    CAST(LEFT(TGT_COL_DATATYPE1, LOCATE(CHAR(10), TGT_COL_DATATYPE1 || CHAR(10))-1) AS VARCHAR(4000)),
                    CAST(FN_SPLITAPENDSPEC(TGT_COL_DATATYPE1) AS VARCHAR(4000)),
                    CAST(LEFT(TGT_COL_LENGTH1, LOCATE(CHAR(10), TGT_COL_LENGTH1 || CHAR(10))-1) AS VARCHAR(50)),
                    CAST(FN_SPLITAPENDSPEC(TGT_COL_LENGTH1) AS VARCHAR(50)),
                    CAST(LEFT(TGT_COL_PRECISION1, LOCATE(CHAR(10), TGT_COL_PRECISION1 || CHAR(10))-1) AS VARCHAR(50)),
                    CAST(FN_SPLITAPENDSPEC(TGT_COL_PRECISION1) AS VARCHAR(50)),
                    CAST(LEFT(TGT_COL_SCALE1, LOCATE(CHAR(10), TGT_COL_SCALE1 || CHAR(10))-1) AS VARCHAR(50)),
                    CAST(FN_SPLITAPENDSPEC(TGT_COL_SCALE1) AS VARCHAR(50)),					
					MAP_SEQ_ID,					
                    MAP_ID,
                    PROJ_ID
   FROM TGT_MAPPING_SPEC_DATA
   WHERE TGT_COLUMN_NAME1 > ''
     OR TGT_TABLE_NAME1 > ''
     OR TGT_SYSTEM_ENVIRONMENT_NAME1 > ''
	 OR TGT_SYSTEM_NAME1 > '')
	 SELECT TGT_SYSTEM_NAME,TGT_SYSTEM_ENVIRONMENT_NAME, TGT_TABLE_NAME, TGT_COLUMN_NAME, TGT_COL_DATATYPE, TGT_COL_LENGTH,
	 TGT_COL_PRECISION, TGT_COL_SCALE, MAP_SEQ_ID, MAP_ID, PROJ_ID FROM TGT_MAPPING_SPEC_DATA
	 WHERE TGT_SYSTEM_NAME <> '' AND  TGT_SYSTEM_ENVIRONMENT_NAME <> '' AND TGT_TABLE_NAME <> '' AND TGT_COLUMN_NAME <> '');
END

-------------------FN_LIN_MAPSPEC_SRCTGT-------------------
CREATE FUNCTION FN_LIN_MAPSPEC_SRCTGT() 
RETURNS TABLE(SRC_SYSTEM_NAME VARCHAR(4000),SRC_SYSTEM_ENVIRONMENT_NAME VARCHAR(4000), SRC_TABLE_NAME VARCHAR(4000), SRC_COLUMN_NAME VARCHAR(4000),SRC_COL_DATATYPE VARCHAR(4000),
	SRC_COL_LENGTH VARCHAR(50), SRC_COL_PRECISION VARCHAR(50), SRC_COL_SCALE VARCHAR(50),TGT_SYSTEM_NAME VARCHAR(4000), TGT_SYSTEM_ENVIRONMENT_NAME VARCHAR(4000), TGT_TABLE_NAME VARCHAR(4000),  
	TGT_COLUMN_NAME VARCHAR(4000), TGT_COL_DATATYPE VARCHAR(4000), TGT_COL_LENGTH VARCHAR(50), TGT_COL_PRECISION VARCHAR(50), TGT_COL_SCALE VARCHAR(50),
	MAP_SEQ_ID INTEGER, MAP_ID BIGINT, PROJ_ID INTEGER)
SPECIFIC LIN_MAPSPEC_SRCTGT_SPEC
READS SQL DATA
SIGNAL SQLSTATE '45000'

ALTER SPECIFIC ROUTINE LIN_MAPSPEC_SRCTGT_SPEC
BEGIN ATOMIC
RETURN TABLE(SELECT SRC.SRC_SYSTEM_NAME,
          SRC.SRC_SYSTEM_ENVIRONMENT_NAME,
          SRC.SRC_TABLE_NAME,
          SRC.SRC_COLUMN_NAME,
	  SRC.SRC_COL_DATATYPE,
          SRC.SRC_COL_LENGTH,
          SRC.SRC_COL_PRECISION,
          SRC.SRC_COL_SCALE,
          TGT.TGT_SYSTEM_NAME,
          TGT.TGT_SYSTEM_ENVIRONMENT_NAME,		  
          TGT.TGT_TABLE_NAME,
          TGT.TGT_COLUMN_NAME,
