CREATE FUNCTION FN_LIN_TAB_FWD_MAPSPEC(SYS_NAME VARCHAR(4000), SYS_ENV_NAME VARCHAR(4000), TABLE_NAME VARCHAR(4000)) 
RETURNS TABLE(PARENT_SRC VARCHAR(4000), SRC_TABLE_NAME VARCHAR(4000), SRC_SYSTEM_ENVIRONMENT_NAME VARCHAR(4000), SRC_SYSTEM_NAME VARCHAR(4000),TGT_TABLE_NAME VARCHAR(4000),TGT_SYSTEM_ENVIRONMENT_NAME VARCHAR(4000), TGT_SYSTEM_NAME VARCHAR(4000),   MAP_SEQ_ID INTEGER, MAP_ID BIGINT, PROJ_ID INTEGER)
SPECIFIC LIN_TAB_FWD_MAPSPEC_SPEC
READS SQL DATA
SIGNAL SQLSTATE '45000'

ALTER SPECIFIC ROUTINE LIN_TAB_FWD_MAPSPEC_SPEC
BEGIN ATOMIC
RETURN TABLE(WITH RECURSIVE TABLIN_SRCTGT_COMP(PARENT_SRC, SRC_TABLE_NAME, SRC_SYSTEM_ENVIRONMENT_NAME, SRC_SYSTEM_NAME,  TGT_TABLE_NAME,  TGT_SYSTEM_ENVIRONMENT_NAME, TGT_SYSTEM_NAME, MAP_SEQ_ID, MAP_ID, PROJ_ID) AS
	(SELECT CAST(NULL AS VARCHAR(4000)) AS PARENT_SRC,
          MS.SRC_TABLE_NAME,
          MS.SRC_SYSTEM_ENVIRONMENT_NAME,
          MS.SRC_SYSTEM_NAME,
          MS.TGT_TABLE_NAME,
          MS.TGT_SYSTEM_ENVIRONMENT_NAME,
          MS.TGT_SYSTEM_NAME,
          MS.MAP_SEQ_ID,
		  MS.MAP_ID,
          MS.PROJ_ID
   FROM TABLE(FN_LIN_MAPSPEC_SRCTGT()) MS
   WHERE UPPER(MS.SRC_SYSTEM_NAME) = UPPER(SYS_NAME)
     AND UPPER(MS.SRC_SYSTEM_ENVIRONMENT_NAME) = UPPER(SYS_ENV_NAME)
     AND UPPER(MS.SRC_TABLE_NAME) = UPPER(TABLE_NAME)
     AND (UPPER(MS.SRC_TABLE_NAME) <> UPPER(MS.TGT_TABLE_NAME)
          OR UPPER(MS.SRC_SYSTEM_NAME) <> UPPER(MS.TGT_SYSTEM_NAME)
          OR UPPER(MS.SRC_SYSTEM_ENVIRONMENT_NAME) <> UPPER(MS.TGT_SYSTEM_ENVIRONMENT_NAME))
   UNION SELECT TABLIN_SRCTGT_COMP.SRC_TABLE_NAME AS PARENT_SRC,
                    MS.SRC_TABLE_NAME,
                    MS.SRC_SYSTEM_ENVIRONMENT_NAME,
                    MS.SRC_SYSTEM_NAME,
                    MS.TGT_TABLE_NAME,
                    MS.TGT_SYSTEM_ENVIRONMENT_NAME,
                    MS.TGT_SYSTEM_NAME,
                    MS.MAP_SEQ_ID,
                    MS.MAP_ID,					
                    MS.PROJ_ID
   FROM TABLE(FN_LIN_MAPSPEC_SRCTGT()) MS
   JOIN TABLIN_SRCTGT_COMP ON UPPER(MS.SRC_TABLE_NAME) = UPPER(TABLIN_SRCTGT_COMP.TGT_TABLE_NAME)
   AND UPPER(MS.SRC_SYSTEM_NAME) = UPPER(TABLIN_SRCTGT_COMP.TGT_SYSTEM_NAME)
   AND UPPER(MS.SRC_SYSTEM_ENVIRONMENT_NAME) = UPPER(TABLIN_SRCTGT_COMP.TGT_SYSTEM_ENVIRONMENT_NAME)
   WHERE (UPPER(MS.SRC_TABLE_NAME) <> UPPER(MS.TGT_TABLE_NAME)
          OR UPPER(MS.SRC_SYSTEM_NAME) <> UPPER(MS.TGT_SYSTEM_NAME)
          OR UPPER(MS.SRC_SYSTEM_ENVIRONMENT_NAME) <> UPPER(MS.TGT_SYSTEM_ENVIRONMENT_NAME)))
	SELECT PARENT_SRC, SRC_TABLE_NAME,SRC_SYSTEM_ENVIRONMENT_NAME,SRC_SYSTEM_NAME,TGT_TABLE_NAME,TGT_SYSTEM_ENVIRONMENT_NAME,  TGT_SYSTEM_NAME,MAP_SEQ_ID,MAP_ID,PROJ_ID FROM 	TABLIN_SRCTGT_COMP);
END


