	TGT_COL_LENGTH,TGT_COL_PRECISION,TGT_COL_SCALE, MAP_SEQ_ID, MAP_ID, PROJ_ID FROM LIN_COL_REV_SRCTGT_COMP);
END
ALTER VIEW SYSTEMDATADICTIONARYSUMMARY (SYSTEM_ID,SYSTEM_ENV_NAME,TABLECOUNT,COLUMNCOUNT) AS
            WITH TABLE_DETAILS AS
            (SELECT SDD.SYSTEM_ID SYSTEM_ID,
            SCE.SYSTEM_ENVIRONMENT_NAME,
            COUNT(STM.TABLE_NAME) COUNT_TABLES
            FROM SYSTEM_DEFINITION_DETAILS SDD
            JOIN SYS_CON_ENVIRONMENTS SCE ON SDD.SYSTEM_ID = SCE.SYSTEM_ID
            JOIN VALID_SYSTEM_TABLE_METADATA STM ON STM.SYSTEM_ID = SDD.SYSTEM_ID
            AND STM.SYSTEM_ENV_NAME = SCE.SYSTEM_ENVIRONMENT_NAME
            GROUP BY SDD.SYSTEM_ID,
            SCE.SYSTEM_ENVIRONMENT_NAME),
            COLUMN_DETAILS AS(
            SELECT SDD.SYSTEM_ID SYSTEM_ID,
            SCE.SYSTEM_ENVIRONMENT_NAME,
            COUNT(STCM.COLUMN_NAME) COUNT_COLUMNS
            FROM SYSTEM_DEFINITION_DETAILS SDD
            JOIN SYS_CON_ENVIRONMENTS SCE ON SDD.SYSTEM_ID = SCE.SYSTEM_ID
            JOIN VALID_SYSTEM_TABLE_METADATA STM ON STM.SYSTEM_ID = SDD.SYSTEM_ID
            AND STM.SYSTEM_ENV_NAME = SCE.SYSTEM_ENVIRONMENT_NAME
            JOIN VALID_SYS_TBL_COL_METADATA STCM ON STCM.SYSTEM_ID = SDD.SYSTEM_ID
            AND STCM.SYSTEM_ENV_NAME = SCE.SYSTEM_ENVIRONMENT_NAME
            AND STCM.TABLE_NAME = STM.TABLE_NAME
            WHERE STCM.type <> 'ENTITY' OR STCM.type IS NULL
            GROUP BY SDD.SYSTEM_ID,
            SCE.SYSTEM_ENVIRONMENT_NAME)
            SELECT CD.SYSTEM_ID, CD.SYSTEM_ENVIRONMENT_NAME, TD.COUNT_TABLES, CD.COUNT_COLUMNS
            FROM COLUMN_DETAILS CD JOIN TABLE_DETAILS TD ON 
            CD.SYSTEM_ID = TD.SYSTEM_ID 
            AND CD.SYSTEM_ENVIRONMENT_NAME = TD.SYSTEM_ENVIRONMENT_NAME;

-------------------FN_PUBLISHMAPCOUNT-------------------
CREATE FUNCTION FN_PUBLISHMAPCOUNT( SUBIDS VARCHAR(4000),  COUNTVALUE INT, EFFECTIVEDATE TIMESTAMP)
RETURNS TABLE(CNTVALUE INT)
SPECIFIC PUBLISHMAPCOUNT_SPEC
READS SQL DATA
SIGNAL SQLSTATE '45000'
-------------------Alter FN_PUBLISHMAPCOUNT-------------------
ALTER SPECIFIC ROUTINE PUBLISHMAPCOUNT_SPEC
BEGIN ATOMIC
    DECLARE TABLE TEMPTABLE(CNTVALUE INT);
    DECLARE TEMPVALUE INT;
    DECLARE CODENAMESTRING VARCHAR(4000);
    DECLARE TEMPEFFECTIVEDATE TIMESTAMP;
    DECLARE TEMPCOUNTVALUE INT;
    
    SET TEMPCOUNTVALUE = COUNTVALUE;
	SET TEMPEFFECTIVEDATE = EFFECTIVEDATE;
    
	SET TEMPVALUE = SELECT COUNT(*) FROM SUBJECT_DETAILS WHERE PARENT_SUBJECT_ID IN (SELECT * FROM TABLE(FN_SPLITTREENODEIDS(SUBIDS,',')));
    IF CAST(TEMPEFFECTIVEDATE AS VARCHAR(40000)) <> ''
    THEN 
      SET TEMPCOUNTVALUE = SELECT COUNT(*) FROM  MAPPING_DETAILS B1 WHERE  B1.ISPUBLISHED = 'Y' 
       AND B1.EFFECTIVE_DATE = NOW() AND SUBJECT_ID IN (SELECT * FROM TABLE(FN_SPLITTREENODEIDS(SUBIDS,',')));
    ELSE
       SET TEMPCOUNTVALUE = SELECT COUNT(*) FROM  MAPPING_DETAILS B1 WHERE  B1.ISPUBLISHED = 'Y' 
       AND B1.EFFECTIVE_DATE <= NOW() AND SUBJECT_ID IN (SELECT * FROM TABLE(FN_SPLITTREENODEIDS(SUBIDS,',')));
    END IF;
    IF TEMPVALUE <> 0 
	THEN
       SET CODENAMESTRING = SELECT COALESCE(CODENAMESTRING || ',', '')  || CAST(SUBJECT_ID AS VARCHAR(4000)) FROM SUBJECT_DETAILS WHERE PARENT_SUBJECT_ID IN (SELECT * FROM TABLE(FN_SPLITTREENODEIDS(SUBIDS,','))); 
       SET TEMPCOUNTVALUE = TEMPCOUNTVALUE + (SELECT * FROM TABLE(FN_PUBLISHMAPCOUNT(CODENAMESTRING,TEMPCOUNTVALUE,NOW())));
    ELSE
        SET TEMPCOUNTVALUE  = TEMPCOUNTVALUE;
     END IF;
    RETURN TABLE (SELECT * FROM TEMPTABLE);
END
