-----------------FN_SELECTPUBLISHEDMAPS-------------------------------
CREATE FUNCTION FN_SELECTPUBLISHEDMAPS()
RETURNS TABLE(PROJ_ID INTEGER,PROJ_NAME VARCHAR(200),SUBJECT_ID INTEGER,SUBJECT_NAME VARCHAR(150),PARENT_SUBJECT_ID INT,SUBJECT_CUSTOM_ORDER FLOAT,MAP_ID BIGINT,MAP_NAME VARCHAR(300),MAP_SPEC_VERSION DECIMAL(10,2),STATUS VARCHAR(50),VERSIONLABEL VARCHAR(100),ACTION_DATE TIMESTAMP)
SPECIFIC SELECTPUBLISHEDMAPS_SPEC
READS SQL DATA
SIGNAL SQLSTATE '45000'

ALTER SPECIFIC ROUTINE SELECTPUBLISHEDMAPS_SPEC
BEGIN ATOMIC
RETURN TABLE(SELECT          	P.PROJ_ID, 
                                P.PROJ_NAME , 
                                SD.SUBJECT_ID, 
                                SD.SUBJECT_NAME , 
                                SD.PARENT_SUBJECT_ID, 
                                SD.SUBJECT_CUSTOM_ORDER, 
                                MS.MAP_ID, 
                                MS.MAP_NAME, 
                                MS.MAP_SPEC_VERSION, 
                                MS.STATUS, 
                                MS.VERSIONLABEL,
                                MAX(MH.ACTION_DATE) AS ACTION_DATE 
                FROM            PROJECT P 
                INNER JOIN      MAPPING_DETAILS MS 
                ON              ( 
                                                MS.PROJECT_ID = P.PROJ_ID 
                                AND             MS.ISPUBLISHED = 'Y' 
                                AND             MS.EFFECTIVE_DATE <= NOW() ) 
                LEFT OUTER JOIN SUBJECT_DETAILS SD 
                ON              (MS.SUBJECT_ID = SD.SUBJECT_ID) 
                
                JOIN            MM_HISTORY MH 
                ON              MH.MAP_ID = MS.MAP_ID 
                GROUP BY        P.PROJ_ID, 
                                P.PROJ_NAME , 
                                SD.SUBJECT_ID, 
                                SD.SUBJECT_NAME , 
                                SD.PARENT_SUBJECT_ID, 
                                SD.SUBJECT_CUSTOM_ORDER, 
                                MS.MAP_ID, 
                                MS.MAP_NAME, 
                                MS.MAP_SPEC_VERSION, 
                                MS.STATUS, 
                                MS.VERSIONLABEL);
END
