CREATE VIEW APPENDED_MAP_SPEC_RCRDS_V (SRC_SYSTEM_NAME,SRC_SYSTEM_ENVIRONMENT_NAME,SRC_TABLE_NAME,SRC_COLUMN_NAME,SRC_COL_DATATYPE,SRC_COL_LENGTH,SRC_COL_PRECISION,SRC_COL_SCALE,TGT_SYSTEM_NAME,TGT_SYSTEM_ENVIRONMENT_NAME,TGT_TABLE_NAME,TGT_COLUMN_NAME,TGT_COL_DATATYPE,TGT_COL_LENGTH,TGT_COL_PRECISION,TGT_COL_SCALE,MAP_SEQ_ID,MAP_ID,PROJ_ID) AS SELECT * FROM TABLE(FN_LIN_MAPSPEC_SRCTGT());

CREATE VIEW MAP_SPEC_NUMLENGTH_RCDS_V AS   SELECT *   FROM   APPENDED_MAP_SPEC_RCRDS_V   WHERE  (SRC_COL_LENGTH ='1' AND TGT_COL_LENGTH = '1'            AND (SELECT * FROM   TABLE(FN_ISINT(SRC_COL_LENGTH))) IS NOT NULL            AND (SELECT *  FROM   TABLE(FN_ISINT(TGT_COL_LENGTH))) IS NOT NULL );

CREATE VIEW IMPACT_ANALYSIS_DETAILS_V AS    SELECT MSNR.MAP_ID,          SRC_COL_LENGTH,          SRC_COL_PRECISION,          TGT_COL_LENGTH,          TGT_COL_PRECISION,          PROJECT.PROJ_ID,          PROJ_NAME,          PROJ_DESCR,          MAPPING_DETAILS.MAP_NAME,          MAPPING_DETAILS.STATUS,          MAPPING_DETAILS.MAP_SPEC_VERSION,          MAPPING_DETAILS.VERSIONLABEL,          MSNR.MAP_SEQ_ID,          MSNR.SRC_TABLE_NAME,          MSNR.TGT_TABLE_NAME,          MSNR.SRC_COLUMN_NAME,          MSNR.TGT_COLUMN_NAME   FROM   APPENDED_MAP_SPEC_RCRDS_V MSNR          LEFT JOIN MAPPING_DETAILS                 ON MSNR.MAP_ID = MAPPING_DETAILS.MAP_ID          LEFT JOIN PROJECT                 ON PROJECT.PROJ_ID = MAPPING_DETAILS.PROJECT_ID   WHERE  LENGTH(TGT_COL_LENGTH) > 0          AND LENGTH(SRC_COL_LENGTH) > 0          AND ( CAST(SRC_COL_LENGTH AS FLOAT) > CAST(TGT_COL_LENGTH AS FLOAT) );

CREATE VIEW IMPACT_ANALYSIS_SUMMARY_V AS   SELECT COUNT(PROJECT.PROJ_ID) AS MAPPINGSCOUNT,          PROJECT.PROJ_ID,          PROJ_NAME,          PROJ_DESCR,          MAPPING_DETAILS.STATUS   FROM   MAP_SPEC_NUMLENGTH_RCDS_V MSNR          LEFT JOIN MAPPING_DETAILS                 ON MSNR.MAP_ID = MAPPING_DETAILS.MAP_ID          LEFT JOIN PROJECT                 ON PROJECT.PROJ_ID = MAPPING_DETAILS.PROJECT_ID   WHERE  LENGTH(TGT_COL_LENGTH) > 0          AND LENGTH(SRC_COL_LENGTH) > 0          AND ( CAST(SRC_COL_LENGTH AS FLOAT) > CAST(TGT_COL_LENGTH AS FLOAT) )          AND PROJECT.PROJ_ID IS NOT NULL   GROUP  BY PROJECT.PROJ_ID,             PROJ_NAME,             PROJ_DESCR,             MAPPING_DETAILS.STATUS;
-----------------------FN_TABNAMEBYSUBID_SRCTGT----------------------------------
CREATE FUNCTION FN_TABNAMEBYSUBID_SRCTGT(SUB_ID INT) 
	RETURNS TABLE(SUBJECT_ID INT)
SPECIFIC TABNAMEBYSUBID_SRCTGT_SPEC
READS SQL DATA
SIGNAL SQLSTATE '45000';

ALTER SPECIFIC ROUTINE TABNAMEBYSUBID_SRCTGT_SPEC
BEGIN ATOMIC
RETURN TABLE(WITH  RECURSIVE CTE(SUBJECT_ID) 
     AS (SELECT SUBJECT_ID 
         FROM   SUBJECT_DETAILS 
         WHERE  SUBJECT_ID = SUB_ID 
         UNION 
         SELECT PS.SUBJECT_ID 
         FROM   SUBJECT_DETAILS AS PS,CTE 
         WHERE  CTE.SUBJECT_ID = PS.PARENT_SUBJECT_ID)
         SELECT SUBJECT_ID FROM CTE);
END
