CREATE FUNCTION FN_DELETE_SUB_AREA(S_ID INTEGER)
RETURNS TABLE(SUBJECT_ID INTEGER)
SPECIFIC DELETE_SUB_AREA
READS SQL DATA
SIGNAL SQLSTATE '45000'

ALTER SPECIFIC ROUTINE DELETE_SUB_AREA
BEGIN ATOMIC
RETURN TABLE
(
WITH recursive n(SUBJECT_ID)  AS 
   (
   SELECT SUBJECT_ID FROM SUBJECT_DETAILS WHERE SUBJECT_ID = S_ID
   UNION ALL
   SELECT PS.SUBJECT_ID FROM SUBJECT_DETAILS AS PS, n WHERE n.SUBJECT_ID = PS.PARENT_SUBJECT_ID
   )
   SELECT SUBJECT_ID  FROM N

);
END